/*Table structure for table `predios` */

DROP TABLE IF EXISTS `predios`;

CREATE TABLE `predios` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `numero_parcela` varchar(15) NOT NULL,
  `nombre_agricultor` varchar(250) NOT NULL,
  `ubicacion` varchar(250) NOT NULL,
  `numero_plantas_original` int(10) NOT NULL,
  `numero_plantas_restantes` int(10) DEFAULT NULL,
  `superficie` decimal(6,2) DEFAULT NULL,
  `nombre_predio` varchar(250) NOT NULL,
  `anio_siembra` smallint(5) NOT NULL,
  `status_ics_original` char(2) NOT NULL,
  `status_ics_este_anio` char(2) DEFAULT NULL,
  `productos_prohibidos` varchar(500) DEFAULT NULL,
  `primera_inspeccion` char(15) DEFAULT NULL,
  `cultivo_2` varchar(250) DEFAULT NULL,
  `cultivo_1` varchar(250) DEFAULT NULL,
  `cultivo` varchar(250) NOT NULL,
  `cultivo_prox_anio` varchar(250) NOT NULL,
  `cosecha_estimada` decimal(6,2) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=477 DEFAULT CHARSET=utf8;

