/* Trigger structure for table `notifications` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `NOTIFICATIONS_DESPUES_INSERTAR` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `NOTIFICATIONS_DESPUES_INSERTAR` AFTER INSERT ON `notifications` FOR EACH ROW BEGIN
           INSERT INTO readings (notifications_id, users_id) 
           SELECT new.id,users_id 
           FROM belong 
           WHERE theme_id = new.theme_id_destino AND activo = 1;
       END */$$


DELIMITER ;

/* Trigger structure for table `readings` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `READINGS_DESPUES_ACTUALIZAR` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `READINGS_DESPUES_ACTUALIZAR` AFTER UPDATE ON `readings` FOR EACH ROW BEGIN
           SET @cantidadUsuariosSinLeer = (SELECT COUNT(id) FROM readings
										   WHERE notifications_id = new.notifications_id AND lectura = 0);
           IF(@cantidadUsuariosSinLeer = 0) THEN
				UPDATE notifications SET lectura = 1 WHERE id = new.notifications_id;
		   ELSE
				UPDATE notifications SET lectura = 0 WHERE id = new.notifications_id;
           END IF;
           
       END */$$


DELIMITER ;

/* Trigger structure for table `synchronize` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `synchronize_BEFORE_INSERT` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `synchronize_BEFORE_INSERT` BEFORE INSERT ON `synchronize` FOR EACH ROW BEGIN
	SET new.creado = CURRENT_TIMESTAMP();
END */$$


DELIMITER ;

/* Function  structure for function  `CALCULAR_TIEMPO_TRANSCURRIDO` */

/*!50003 DROP FUNCTION IF EXISTS `CALCULAR_TIEMPO_TRANSCURRIDO` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`turbo`@`%` FUNCTION `CALCULAR_TIEMPO_TRANSCURRIDO`(p_fecha DATETIME) RETURNS text CHARSET utf8mb4
BEGIN
	DECLARE v_tiempo_trasncurrido TEXT;
	DECLARE v_hoy DATETIME DEFAULT CURRENT_TIMESTAMP;
	DECLARE v_tiempoPasado BIGINT DEFAULT (UNIX_TIMESTAMP(v_hoy) - UNIX_TIMESTAMP(p_fecha)) * 1000;
	
	/* CALCULAR MILISEGUNDOS POR AO*/
	DECLARE v_segs SMALLINT(5) DEFAULT 1000;
	DECLARE v_mins INTEGER(10) DEFAULT v_segs * 60;
	DECLARE v_hours INTEGER(10) DEFAULT v_mins * 60;
	DECLARE v_days INTEGER(10) DEFAULT v_hours * 24;
	DECLARE v_months DECIMAL(20,9) DEFAULT v_days * 30.416666666666668;
	DECLARE v_years DECIMAL(20,9) DEFAULT v_months * 12;
	
	DECLARE v_anos SMALLINT(5);
	DECLARE v_meses SMALLINT(5);
	DECLARE v_dias SMALLINT(5);
	DECLARE v_horas SMALLINT(5);
	DECLARE v_minutos SMALLINT(5);
	DECLARE v_segundos SMALLINT(5);
	
	-- CALCULOS
	SET v_anos = TRUNCATE((v_tiempoPasado / v_years),0);
	
	SET v_tiempoPasado = v_tiempoPasado - (v_anos * v_years);	
	SET v_meses = TRUNCATE((v_tiempoPasado / v_months), 0);	

	SET v_tiempoPasado = v_tiempoPasado - (v_meses * v_months);
	SET v_dias = TRUNCATE((v_tiempoPasado / v_days), 0);

	SET v_tiempoPasado = v_tiempoPasado - (v_dias * v_days);	
	SET v_horas = TRUNCATE((v_tiempoPasado / v_hours), 0);

	SET v_tiempoPasado = v_tiempoPasado - (v_horas * v_hours);
	SET v_minutos = TRUNCATE((v_tiempoPasado / v_mins), 0);

	SET v_tiempoPasado = v_tiempoPasado - (v_minutos * v_mins);
	SET v_segundos = TRUNCATE((v_tiempoPasado / v_segs), 0);

	
	IF(v_anos > 0) THEN 
		SET v_tiempo_trasncurrido = CONCAT(v_anos, ' aos');
	ELSEIF(v_meses > 0) THEN 
		SET v_tiempo_trasncurrido = CONCAT(v_meses, ' meses');
	ELSEIF(v_dias > 0) THEN 
		SET v_tiempo_trasncurrido = CONCAT(v_dias, ' dias');
	ELSEIF(v_horas > 0) THEN 
		SET v_tiempo_trasncurrido = CONCAT(v_horas, ' hrs');
	ELSEIF(v_minutos > 0) THEN 
		SET v_tiempo_trasncurrido = CONCAT(v_minutos, ' mins');
	ELSE
		SET v_tiempo_trasncurrido = CONCAT('justo ahora');		
	END IF;
	
	RETURN v_tiempo_trasncurrido;
    END */$$
DELIMITER ;

